import { container } from "assets/jss/material-kit-react.js";

const componentsStyle = {

  container,
  brand: {
    position: 'absolute',
    color: "#ffffff",
    zIndex: "1000",
    marginLeft: "30vw",
    marginTop: "2vh",
  },
  '@media (max-width: 800px)': {
    title: {
      fontFamily: "army",
      fontSize: "12vw",
      fontWeight: "600",
      display: "inline-block",
      position: "relative"
    },
    subtitle: {
      fontSize: "1.313rem",
      maxWidth: "500px",
      marginLeft: "17vw",
    },  
  },

  '@media (min-width: 800px)': {
    title: {
      fontFamily: "army",
      fontSize: "6vw",
      fontWeight: "600",
      display: "inline-block",
      position: "relative"
    },
    subtitle: {
      fontSize: "1vw",
      maxWidth: "500px",
      marginLeft: "5vw"
    },
  },

  main: {
    background: "#FFFFFF",
    position: "relative",
    zIndex: "3"
  },
  mainRaised: {
    margin: "-60px 30px 0px",
    borderRadius: "6px",
    boxShadow:
      "0 16px 24px 2px rgba(0, 0, 0, 0.14), 0 6px 30px 5px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2)"
  },
  link: {
    textDecoration: "none"
  },
  textCenter: {
    textAlign: "center"
  },
  pills: {
    backgroundColor: '#6B61E8',  
    clipPath: 'polygon(0 0%, 100% 0%, 24% 45%, 0% 100%)',
    backgroundColor: '#78C0FF',
    clipPath: 'polygon(24% 45%, 100% 0%, 100% 100%, 0% 100%)',
  }
};

export default componentsStyle;
